import React, { StrictMode } from 'react'
import {connect} from "react-redux";
import store from './../store'
//import actions
import { addToHistory, delFromHistory} from './../Components/userInfo/userInfoAction'



function History(props) {
    return (
        <div>
            <table>
            <thead>
                    <tr>
                        <th>Book Name</th>
                        <th>Last Accessed</th>
                        <th>History</th>
                    </tr>
                </thead>
                <tbody>
                    {/* history */}
                    {props.history.map((b)=>(
                        <tr>
                            <td>{props.titlefun(b.id).title}</td>
                            <td>{b.date}</td>
                            <td><button onClick={()=>props.delbutton(b.id, b.date)}>Delete</button></td>
                        </tr>
                    ))}

                </tbody>
            </table>
        </div>
    )
}

const mapStateToProps = (state)=>{
    console.log('state:',state)
    return {
        info: state.userInfo
    }
}


export default connect()(History)
